    data: |
      SELECT ALL 63 + col0 AS col2 FROM tab0 (FORMAT parquet) WHERE NOT col2 / + + col2 + + ( + ( + col0 ) ) * - col0 / col2 + - 5 * + col0 NOT BETWEEN + + CAST ( NULL AS INTEGER ) * - - col0 AND + ( 87 );
  - name: tab0

outputs:
  - name: q2045.out
    data: |
